$('.clickable').click(function() {
  $(this).parent().css({'webkit-transform' : 'rotate(0deg)',
                        bottom : '-400px',
                        'z-index' : '1000'});
  $(this).parent().find('.close').css('display', 'block');
});

$('.about .close').click(function() {
  $('.about').css({'transform' : 'rotate(13deg)',
                   bottom : '-690px',
                   cursor : 'pointer'});
  $('.close').css('display', 'none');
});

$('.work .close').click(function() {
  $('.work').css({'transform' : 'rotate(9deg)',
                   bottom : '-620px',
                   cursor : 'pointer',
                  'z-index' : 40});
  $('.close').css('display', 'none');
});

$('.school .close').click(function() {
  $('.school').css({'transform' : 'rotate(12deg)',
                   bottom : '-580px',
                   cursor : 'pointer',
                   'z-index' : 30});
  $('.close').css('display', 'none');
});

$('.hobbies .close').click(function() {
  $('.hobbies').css({'transform' : 'rotate(10deg)',
                   bottom : '-520px',
                   cursor : 'pointer',
                   'z-index' : 20});
  $('.close').css('display', 'none');
});
